import sys, math, operator
from random import randint
from collections import Counter
import re

def main(argv):

	index = 0
	currentLine=""
	sequenceNum=0
	string = ""

	for character in string:
		if index == 160:
			sequenceNum+=1
			print(">seq_" + str(sequenceNum))
			print(currentLine)
			index=0
			currentLine=""
		else:
			index+=1
			currentLine+=character
	
	sequenceNum+=1
	print(">seq_" + str(sequenceNum))
	print(currentLine)


if __name__ == "__main__":
    main(sys.argv[0:])